import React, { useState } from "react";
import SignIn from "./SignIn";

const AppData = () => {
	const adminUser = {
		email: "admin@admin.com",
		bookingRef: "12345",
	};

	const [user, setUser] = setState({ name: "", email: "", bookingRef: "" });
	const [error, setError] = setState("");

	const Login = (details) => {
		console.log(details);
	};

	const Logout = () => {
		console.log("Logout");
	};

	return (
		<>
			<p>Hello!</p>
			{user.email != "" ? (
				<div className="welcome">
					<p>Welcome to the second screen {user.name}!</p>
					<button>Logout</button>
				</div>
			) : (
				<SignIn />
			)}
		</>
	);
};

export default AppData;
